import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import contact from "./contacts";
import Taoanhtren from "./taoasnav";
import { Taoanhduoi } from "./taoasnav";

var lp = window.location.pathname.slice(1)
lp = lp.replace(/%20/g, " ")

function createCardz(contact) {
  if (contact.name == lp)
  return contact.hinh.map(createCardzz)
}
function createCardzz(hinh) {
  return (
   <Taoanhtren 
    hinh = {hinh}
   />
  )
}

function createCardzzz(contact) {
  if (contact.name == lp){
    return (
    <Slider 
    asNavFor={this.state.nav1}
    ref={slider => (this.slider2 = slider)}
    slidesToShow={2}
    swipeToSlide={true}
    focusOnSelect={true}
  >
    {contact.hinh.map(createCardzzzz)}
  </Slider>
    )
  }
}
function createCardzzzz(hinh) {
  return (
   <Taoanhduoi
    hinh = {hinh}
   />
  )
}

export default class AsNavFor extends Component {
  constructor(props) {
    super(props);
    this.state = {
      nav1: null,
      nav2: null
    };
  }

  componentDidMount() {
    this.setState({
      nav1: this.slider1,
      nav2: this.slider2
    });
  }

  render() {
    return (
      <div className = "slide">
        <Slider 
          asNavFor={this.state.nav2}
          ref={slider => (this.slider1 = slider)}
        >
         {contact.map(createCardz)}
        </Slider>
     
         
      
      </div>
    );
  }
}
